INSERT INTO `project` VALUES ('DST SP2024-15','DST','2024','MIND BLOOM: A MOBILE APPLICATION FOR \nMENTAL HEALTH SELF-CARE \nมายดบลม: แอปพลเคชนมอถอสาหรบดแลสขภาพจต','Developer','การวิจัยและพัฒนาโมเดล Deep learning สำหรับตรวจจับและจำแนกสายพันธุ์และเพศของยุงโดยอาศัยเสียงการกระพือปีกในสภาพแวดล้อมที่มีเสียงรบกวนหลากหลายรูปแบบและสามารถทำงานบนอุปกรณ์ IoT เพื่อการควบคุมยุงและป้องกันโรคอย่างมีประสิทธิภาพ\n\n','2024-12-10 00:00:00','2024-12-10 00:00:00','P.Ittipol','P.Ittipol'),('DST SP2024-16','DST','2024',' แพลตฟอรมสาหรบการจดการผลผลตงานใน\n กระบวนการพฒนาซอฟตแวร','Developer','\"การนำเทคโนโลยี IoT มาติดตั้งในห้องเรียน \nเพื่อตรวจสอบการใช้พลังงานอุปกรณ์ต่างๆ\nภายในห้องเรียนแบบเรียลไทม์\"\n\n','2024-12-11 00:00:00','2024-12-10 00:00:00','P.Ittipol','P.Ittipol'),('DST SP2024-17','DST','2024','WEB-BASED APPLICATION FOR SUPPORT ICT- \nPORTFOLIO ADMISSION','Developer','\"Develop a robust and intelligent chatbot designed to assist users with NDID-related inquiries in both English and Thai. This chatbot will leverage advanced natural language processing capabilities to deliver human-like responses while adhering to a secure architecture based on the OWASP Top 10 guidelines for Large Language Models (LLMs). By addressing key security concerns, such as prompt injection and data leakage, the solution ensures a safe and reliable interaction environment.\n      Additionally, the system will integrate an automated issue tracking mechanism that generates tickets for unresolved queries, facilitating seamless escalation and efficient resolution of user concerns.\"\n\n','2024-12-12 00:00:00','2024-12-10 00:00:00','P.Ittipol','P.Ittipol'),('DST SP2024-18','DST','2024',' การพฒนาแพลตฟอรมโซเชยลมเดยโดยใชแนว\n ทางการทางานแบบอไจล','Developer','ระบบจัดการฝึกงานสำหรับคณะ ICT\n\n','2024-12-13 00:00:00','2024-12-10 00:00:00','P.Ittipol','P.Ittipol'),('DST SP2024-19','DST','2024','INT CONNECT','Developer','เป็น Website ที่ใช้เพื่อช่วยในการวางแผน จัดการ และติดตามกระบวนการทำงานในโครงการต่าง ๆ โดยเครื่องมือเ